package org.apache.commons.text;

import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.Assertions;

public class RandomStringGeneratorTest1 {

    @Test
    void testFilteredByReplacement() {
        // Step 0: Initialize RandomStringGenerator.Builder.
        RandomStringGenerator.Builder builder = RandomStringGenerator.builder();

        // Step 1: Configure a random text generator to produce characters within the 'a' to 'z' range.
        builder.withinRange(new char[][]{{'a', 'z'}});

        // Step 2: Apply an initial filtering rule to the generator configuration.
        builder.filteredBy(c -> c >= 'a' && c <= 'z');

        // Step 3: Replace the generator's filtering rule with a new rule that permits only the character 'b'.
        builder.filteredBy(c -> c == 'b');

        // Step 4: Finalize the generator configuration.
        RandomStringGenerator finalized_generator = builder.build();

        // Step 5: Produce a text sequence of one hundred characters using the configured generator.
        String generated_text_sequence = finalized_generator.generate(100);

        // Step 6: Assert that every individual character in the generated text sequence is 'b'.
        for (char c : generated_text_sequence.toCharArray()) {
            Assertions.assertEquals('b', c, "All characters in the generated sequence should be 'b'");
        }
    }
}

