import org.junit.jupiter.api.Assertions;
import org.junit.jupiter.params.ParameterizedTest;
import org.junit.jupiter.params.provider.ValueSource;
import org.apache.commons.text.RandomStringGenerator;

import java.util.Arrays;
import java.util.HashSet;
import java.util.Set;
import java.util.stream.Collectors;

public class RandomStringGeneratorTest {

    // Step 0: Define the initial reference character set for verification
    private static final Set<Character> initial_reference_set = new HashSet<>(Arrays.asList('a', 'b', 'c', 'd', 'e'));

    @ParameterizedTest
    @ValueSource(booleans = {true, false})
    void testRandomTextGenerationWithAccumulation(boolean accumulate) {
        // Step 1: Initialize the random text generation system builder
        RandomStringGenerator.Builder builder = RandomStringGenerator.builder();

        // Step 2: Configure the text generator with an initial reference character set of five specific characters
        builder.selectFrom(new char[]{'a', 'b', 'c', 'd', 'e'});

        // Step 3: Apply a configuration specifying a 4-character subset
        builder.selectFrom(new char[]{'a', 'b', 'c', 'd'});

        // Step 4: Apply a configuration specifying a 3-character subset
        builder.selectFrom(new char[]{'a', 'b', 'c'});

        // Step 5: Apply a configuration specifying a 2-character subset
        builder.selectFrom(new char[]{'a', 'b'});

        // Step 6 / Step 15: Enable or disable accumulation behavior based on the parameter
        builder.setAccumulate(accumulate);

        // Step 7 / Step 16: Build the random text generator
        RandomStringGenerator text_generator = builder.get();

        // Step 8 / Step 17: Instruct the system to produce a random text output of ten characters
        String generated_text = text_generator.generate(10);

        if (accumulate) {
            // Step 9: Verify every character in the generated text is present within the initial reference character set
            for (char c : generated_text.toCharArray()) {
                Assertions.assertTrue(initial_reference_set.contains(c),
                        "Character '" + c + "' in generated text was not found in initial reference set when accumulation is ON.");
            }
        } else {
            // Step 18: Verify no character in the generated text is present within the initial reference character set
            for (char c : generated_text.toCharArray()) {
                Assertions.assertFalse(initial_reference_set.contains(c),
                        "Character '" + c + "' in generated text was unexpectedly found in initial reference set when accumulation is OFF.");
            }
        }
    }
}

