public class CircularReferenceTest {

    @Test
    public void testCircularReferenceDetection() {
        // Step 0: Configure text substitution system with custom angle bracket delimiters and define the self-referential variable.
        Map<String, String> variableMap = new HashMap<>();
        variableMap.put("name", "<name>");
        StringSubstitutor substitutor_instance = new StringSubstitutor(variableMap, "<", ">");
        substitutor_instance.setEnableSubstitutionInVariables(true);

        // Step 1: Create a greeting message containing the self-referential variable
        String greeting_message_with_circular_ref = "Hello <name>!";

        // Step 2 & 3: Attempt to perform text substitution on the greeting message and verify it raises an IllegalStateException
        assertThrows(IllegalStateException.class, () -> {
            substitutor_instance.replace(greeting_message_with_circular_ref);
        });
    }
}

