import org.junit.jupiter.api.Test;
import static org.junit.jupiter.api.Assertions.assertEquals;
import static org.junit.jupiter.api.Assertions.assertTrue;
import org.junit.jupiter.api.Assertions;

public class TextCompositionSystemTest3 { // Changed class name back to original

    @Test
    void testTextCompositionInsertionAtEndWithBoundaryProtection() {
        // Step 0: Create an empty text composition instance
        StringBuilder text_composition_instance = new StringBuilder();

        // Step 2: Confirm the text composition instance is empty
        assertTrue(text_composition_instance.toString().isEmpty());

        // Step 3: Insert a text segment 'Hello' at the start position (0) into the text composition instance
        text_composition_instance.insert(0, "Hello");

        // Step 4: Verify the content of the text composition instance matches 'Hello'
        assertEquals("Hello", text_composition_instance.toString());

        // Step 5: Get the current length of the text composition instance
        int current_length = text_composition_instance.length();

        // Step 6: Attempt to insert content at position -1
        Assertions.assertThrows(IndexOutOfBoundsException.class, () -> text_composition_instance.insert(-1, "invalid"));

        // Step 7: Attempt to insert content at position beyond the current end boundary
        Assertions.assertThrows(IndexOutOfBoundsException.class, () -> text_composition_instance.insert(current_length + 1, "invalid"));

        // Step 8: Verify the text composition instance content remains 'Hello'
        assertEquals("Hello", text_composition_instance.toString());

        // Step 9: Insert a boolean value 'true' at the current end position
        text_composition_instance.insert(text_composition_instance.length(), true);

        // Step 10: Confirm the text composition instance appends the text representation 'true'
        assertEquals("Hellotrue", text_composition_instance.toString());

        // Step 11: Get the current length of the text composition instance
        int current_length_after_true = text_composition_instance.length();

        // Step 12: Attempt to insert content at position -1
        Assertions.assertThrows(IndexOutOfBoundsException.class, () -> text_composition_instance.insert(-1, "invalid"));

        // Step 13: Attempt to insert content at position beyond the current end boundary
        Assertions.assertThrows(IndexOutOfBoundsException.class, () -> text_composition_instance.insert(current_length_after_true + 1, "invalid"));

        // Step 14: Verify the text composition instance content remains 'Hellotrue'
        assertEquals("Hellotrue", text_composition_instance.toString());

        // Step 15: Insert a single character '!' at the end position
        text_composition_instance.insert(text_composition_instance.length(), '!');

        // Step 16: Validate the updated content of the text composition instance matches 'Hellotrue!'
        assertEquals("Hellotrue!", text_composition_instance.toString());

        // Step 17: Get the current length of the text composition instance
        int current_length_after_exclamation = text_composition_instance.length();

        // Step 18: Insert a character sequence ' World' at the end position
        text_composition_instance.insert(text_composition_instance.length(), " World");

        // Step 19: Attempt to insert content at a position beyond the new end boundary
        Assertions.assertThrows(IndexOutOfBoundsException.class, () -> text_composition_instance.insert(current_length_after_exclamation + " World".length() + 1, "invalid"));

        // Step 20: Confirm the sequence ' World' appears in the output
        assertEquals("Hellotrue! World", text_composition_instance.toString());

        // Step 21: Verify the text composition instance content remains 'Hellotrue! World'
        assertEquals("Hellotrue! World", text_composition_instance.toString());

