public class StringBuilderInsertTest {

    @Test
    public void testInsertOperations() {
        // Step 0: Instantiate a new Text String Builder
        StringBuilder text_string_builder = new StringBuilder();

        // Step 1: Verify the initial state of the text string builder
        assertEquals("", text_string_builder.toString());

        // Step 2: Insert a string literal at position zero
        text_string_builder.insert(0, "Hello");

        // Step 3: Confirm the resulting content matches the inserted string literal
        assertEquals("Hello", text_string_builder.toString());

        // Step 4: Assert that inserting at a negative index triggers IndexOutOfBoundsException
        assertThrows(IndexOutOfBoundsException.class, () -> text_string_builder.insert(-1, "a"));

        // Step 5: Assert that inserting beyond current length triggers IndexOutOfBoundsException
        assertThrows(IndexOutOfBoundsException.class, () -> text_string_builder.insert(text_string_builder.length() + 1, "a"));

        // Step 6: Insert a boolean value at the current end position
        text_string_builder.insert(text_string_builder.length(), true);

        // Step 7: Validate the updated string representation reflects the appended boolean text
        assertEquals("Hellotrue", text_string_builder.toString());

        // Step 8: Verify that inserting at a negative offset for boolean produces boundary exceptions
        assertThrows(IndexOutOfBoundsException.class, () -> text_string_builder.insert(-1, true));

        // Step 9: Verify that inserting beyond current length for boolean produces boundary exceptions
        assertThrows(IndexOutOfBoundsException.class, () -> text_string_builder.insert(text_string_builder.length() + 1, true));

        // Step 10: Insert a character at the terminal position
        text_string_builder.insert(text_string_builder.length(), 'c');

        // Step 11: Confirm the character is appended correctly
        assertEquals("Hellotruec", text_string_builder.toString());

        // Step 12: Ensure invalid index insertions for char fail appropriately (negative index)
        assertThrows(IndexOutOfBoundsException.class, () -> text_string_builder.insert(-1, 'x'));

        // Step 13: Ensure invalid index insertions for char fail appropriately (beyond length)
        assertThrows(IndexOutOfBoundsException.class, () -> text_string_builder.insert(text_string_builder.length() + 1, 'x'));

        // Step 14: Insert a character array at the end position
        text_string_builder.insert(text_string_builder.length(), new char[]{'x', 'y'});

        // Step 15: Verify the array contents are incorporated into the builder's string representation
        assertEquals("Hellotruecxy", text_string_builder.toString());

        // Step 16: Validate that array insertions at negative indices raise exceptions
        assertThrows(IndexOutOfBoundsException.class, () -> text_string_builder.insert(-1, new char[]{'a'}));

        // Step 17: Validate that array insertions at positions exceeding the current size raise exceptions
        assertThrows(IndexOutOfBoundsException.class, () -> text_string_builder.insert(text_string_builder.length() + 1, new char[]{'a'}));

        // Step 18: Insert a subset of a character array using offset and length parameters at the terminal position
        text_string_builder.insert(text_string_builder.length(), new char[]{'a', 'b', 'c', 'd'}, 1, 2);

        // Step 19: Confirm only the specified portion is inserted
        assertEquals("Hellotruecxybc", text_string_builder.toString());

        // Step 20: Verify that inserting partial array at negative index triggers errors
        assertThrows(IndexOutOfBoundsException.class, () -> text_string_builder.insert(-1, new char[]{'a'}, 0, 1));

        // Step 21: Verify that inserting partial array beyond current length triggers errors
        assertThrows(IndexOutOfBoundsException.class, () -> text_string_builder.insert(text_string_builder.length() + 1, new char[]{'a'}, 0, 1));

        // Step 22: Verify that inserting partial array with negative source offset triggers errors
        assertThrows(IndexOutOfBoundsException.class, () -> text_string_builder.insert(0, new char[]{'a'}, -1, 1));

        // Step 23: Verify that inserting partial array with negative length triggers errors
        assertThrows(IndexOutOfBoundsException.class, () -> text_string_builder.insert(0, new char[]{'a'}, 0, -1));

        // Step 24: Verify that inserting partial array with offset + length exceeding array size triggers errors
        assertThrows(IndexOutOfBoundsException.class, () -> text_string_builder.insert(0, new char[]{'a'}, 0, 2));

        // Step 25: Insert a double value at the end
        text_string_builder.insert(text_string_builder.length(), 1.23);

        // Step 26: Validate its string representation appears in the builder
        assertEquals("Hellotruecxybc1.23", text_string_builder.toString());

        // Step 27: Confirm boundary violations for double insertions are detected (negative index)
        assertThrows(IndexOutOfBoundsException.class, () -> text_string_builder.insert(-1, 1.0));

        // Step 28: Confirm boundary violations for double insertions are detected (beyond length)
        assertThrows(IndexOutOfBoundsException.class, () -> text_string_builder.insert(text_string_builder.length() + 1, 1.0));

        // Step 29: Insert a float value at the terminal position
        text_string_builder.insert(text_string_builder.length(), 4.56f);

        // Step 30: Verify its conversion to string format is correctly appended
        assertEquals("Hellotruecxybc1.234.56", text_string_builder.toString());

        // Step 31: Confirm corresponding boundary checks for float (negative index)
        assertThrows(IndexOutOfBoundsException.class, () -> text_string_builder.insert(-1, 1.0f));

        // Step 32: Confirm corresponding boundary checks for float (beyond length)
        assertThrows(IndexOutOfBoundsException.class, () -> text_string_builder.insert(text_string_builder.length() + 1, 1.0f));

        // Step 33: Insert an integer at the end position
        text_string_builder.insert(text_string_builder.length(), 789);

        // Step 34: Confirm the numeric string representation is incorporated
        assertEquals("Hellotruecxybc1.234.56789", text_string_builder.toString());

        // Step 35: Ensure invalid index attempts for integer fail (negative index)
        assertThrows(IndexOutOfBoundsException.class, () -> text_string_builder.insert(-1, 1));

        // Step 36: Ensure invalid index attempts for integer fail (beyond length)
        assertThrows(IndexOutOfBoundsException.class, () -> text_string_builder.insert(text_string_builder.length() + 1, 1));

        // Step 37: Insert a long value at the terminal position
        text_string_builder.insert(text_string_builder.length(), 12345L);

        // Step 38: Validate its string conversion appears correctly
        assertEquals("Hellotruecxybc1.234.5678912345", text_string_builder.toString());

        // Step 39: Handle appropriate exception handling for long (negative index)
        assertThrows(IndexOutOfBoundsException.class, () -> text_string_builder.insert(-1, 1L));

        // Step 40: Handle appropriate exception handling for long (beyond length)
        assertThrows(IndexOutOfBoundsException.class, () -> text_string_builder.insert(text_string_builder.length() + 1, 1L));

        // Step 41: Insert an object reference at the end position
        Object object_reference = new Object();
        text_string_builder.insert(text_string_builder.length(), object_reference);

        // Step 42: Verify the object's string representation is appended to the builder
        assertEquals("Hellotruecxybc1.234.5678912345" + object_reference.toString(), text_string_builder.toString());

        // Step 43: Confirm that insertions beyond valid indices or at negative positions produce index out of bounds errors (negative index)
        assertThrows(IndexOutOfBoundsException.class, () -> text_string_builder.insert(-1, new Object()));

        // Step 44: Confirm that insertions beyond valid indices or at negative positions produce index out of bounds errors (beyond length)
        assertThrows(IndexOutOfBoundsException.class, () -> text_string_builder.insert(text_string_builder.length() + 1, new Object()));
    }
}

