        // Step 3: Assert that the period character is not identified as a word separator
        assertFalse(isPeriodSeparatorResultDefault, "Period should not be a separator with default rules");

        // Step 4: Assert that the space character is identified as a word separator
        assertTrue(isSpaceSeparatorResultDefault, "Space should be a separator with default rules");

        // Step 5: Configure system with custom word separators that explicitly exclude a period
