    void setUp() throws IOException {
        // Step 0: Configure system property for external DTD access to allow file protocol access
        originalDtdPropertyValue = System.setProperty("javax.xml.accessExternalDTD", "file");
    }

    @AfterEach
    void tearDown() {
        // Step 8: Reset system property for external DTD access
        if (originalDtdPropertyValue != null) {
            System.setProperty("javax.xml.accessExternalDTD", originalDtdPropertyValue);
        } else {
            System.clearProperty("javax.xml.accessExternalDTD");
        }

        // Step 9: Delete the created XML document file
        if (xmlDocumentFile != null) {
            try {
                Files.deleteIfExists(xmlDocumentFile);
            } catch (IOException e) {
                System.err.println("Failed to delete XML document file: " + e.getMessage());
            }
        }

        // Step 10: Delete the created DTD file
        if (dtdFile != null) {
            try {
                Files.deleteIfExists(dtdFile);
            } catch (IOException e) {
                System.err.println("Failed to delete DTD file: " + e.getMessage());
            }
        }
    }

    @Test
    void testXmlDtdInterpolation() throws IOException {
        // Step 2: Create an external DTD file containing the expected content
        expectedExternalEntityContent = "This is content from the external DTD.";
        dtdFile = Files.createTempFile("external", ".dtd");
        Files.write(dtdFile, ("<!ENTITY externalContent \"" + expectedExternalEntityContent + "\">").getBytes(StandardCharsets.UTF_8));
        System.out.println("DTD File URI: " + dtdFile.toUri().toString());

        // Step 1: Create an XML document file with an external DTD entity reference
        xmlDocumentFile = Files.createTempFile("document", ".xml");
        String xmlContent = "<!DOCTYPE doc [\n" +
                            "  <!ENTITY % dtd SYSTEM \"" + dtdFile.toUri().toString() + "\">\n" +
                            "  %dtd;\n" +
                            "]>\n" +
                            "<doc>&externalContent;</doc>";
        Files.write(xmlDocumentFile, xmlContent.getBytes(StandardCharsets.UTF_8));
        System.out.println("XML Document File URI: " + xmlDocumentFile.toUri().toString());

        // Step 3: Initialize a String Substitutor configured with XML document parsing capability
        StringSubstitutor stringSubstitutor = StringSubstitutor.createInterpolator();

        // Step 4: Construct an interpolation expression string referencing the XML document file path and an XPath expression
        String interpolation_expression = "${xml:" + xmlDocumentFile.toAbsolutePath().toString() + ":/doc}";
        System.out.println("Interpolation Expression: " + interpolation_expression);

        // Step 5: Invoke the replace method on the substitutor with the interpolation expression
        String raw_interpolated_result = stringSubstitutor.replace(interpolation_expression);
        System.out.println("Raw Interpolated Result: " + raw_interpolated_result);

        // Step 6: Trim whitespace from the interpolated result
        String trimmed_interpolated_result = raw_interpolated_result.trim();

        // Step 7: Assert that the trimmed result equals the expected external entity content string
        Assertions.assertEquals(expectedExternalEntityContent, trimmed_interpolated_result);
    }
}

