import static org.junit.jupiter.api.Assertions.*;
import org.apache.commons.text.similarity.LevenshteinDistance;

public class TextSimilarityTest {

    @Test
    void testEditDistanceCalculationWithThreshold() {
        // Step 0: Configure the text similarity comparison system with a specific threshold limit
        int thresholdValue = 5;
        LevenshteinDistance configuredComparisonSystem = new LevenshteinDistance(thresholdValue);

        // --- First Test Case ---

        // Step 1: Provide a first text sequence for comparison
        String firstTextSequence = "kitten";

        // Step 2: Provide a second text sequence for comparison
        String secondTextSequence = "sitting";

        // Step 3: Determine the expected edit distance for the given text sequences
        int expectedEditDistance = 3;

        // Step 4: Measure the edit distance between the first text sequence and the second text sequence
        Integer forwardEditDistance = configuredComparisonSystem.apply(firstTextSequence, secondTextSequence);

        // Step 5: Measure the edit distance between the second text sequence and the first text sequence
        Integer reverseEditDistance = configuredComparisonSystem.apply(secondTextSequence, firstTextSequence);

        // Step 6: Assert that the forward edit distance is equal to the reverse edit distance
        assertEquals(forwardEditDistance, reverseEditDistance, "Forward and reverse edit distances should be equal");

        // Step 7: Assert that the forward edit distance matches the expected edit distance
        assertEquals(expectedEditDistance, forwardEditDistance, "Forward edit distance should match expected");

        // Step 8: Assert that the calculated edit distance respects the configured threshold boundary
        if (expectedEditDistance <= thresholdValue) {
            assertEquals(expectedEditDistance, forwardEditDistance, "Edit distance should match expected when within threshold");
        } else {
            assertEquals(-1, forwardEditDistance, "Edit distance should be -1 when exceeding threshold");
        }

        // --- Second Test Case ---

        // Step 9: Provide a different first text sequence for comparison
        String firstTextSequence2 = "flaw";

        // Step 10: Provide a different second text sequence for comparison
        String secondTextSequence2 = "lawn";

        // Step 11: Determine the expected edit distance for the different text sequences
        int expectedEditDistance2 = 2;

        // Step 12: Measure the edit distance between the different first text sequence and the different second text sequence
        Integer forwardEditDistance2 = configuredComparisonSystem.apply(firstTextSequence2, secondTextSequence2);

        // Step 13: Measure the edit distance between the different second text sequence and the different first text sequence
        Integer reverseEditDistance2 = configuredComparisonSystem.apply(secondTextSequence2, firstTextSequence2);

        // Step 14: Assert that the different forward edit distance is equal to the different reverse edit distance
        assertEquals(forwardEditDistance2, reverseEditDistance2, "Forward and reverse edit distances for second case should be equal");

        // Step 15: Assert that the different forward edit distance matches the different expected edit distance
        assertEquals(expectedEditDistance2, forwardEditDistance2, "Forward edit distance for second case should match expected");

        // Step 16: Assert that the calculated edit distance respects the configured threshold boundary for the different input
        if (expectedEditDistance2 <= thresholdValue) {
            assertEquals(expectedEditDistance2, forwardEditDistance2, "Edit distance for second case should match expected when within threshold");
        } else {
            assertEquals(-1, forwardEditDistance2, "Edit distance for second case should be -1 when exceeding threshold");
        }

        // Step 17: Reset the text similarity comparison system configuration (handled by method scope)
    }
}

