import java.util.stream.Stream;

public class DamerauLevenshteinDistanceTest {

    @ParameterizedTest
    @MethodSource("damerauLevenshteinDistanceTestCases")
    public void testDamerauLevenshteinDistance(
            String left_string,
            String right_string,
            int threshold,
            int expected_distance) {

        // NOTE: This test code assumes the Apache Commons Text library (org.apache.commons.text)
        // is available on the classpath. Compilation will fail if it's missing.

        // Step 1: Construct a new DamerauLevenshteinDistance instance configured with the provided threshold value
        DamerauLevenshteinDistance damerau_levenshtein_instance = new DamerauLevenshteinDistance(threshold);

        // Step 2 & 3: Construct SimilarityInput wrapper objects from string content using a utility helper
        // CharSequenceSimilarityInput is part of Apache Commons Text and is required here.
        SimilarityInput left_similarity_input = createSimilarityInput(left_string);
        SimilarityInput right_similarity_input = createSimilarityInput(right_string);

        // Step 4: Invoke the apply method on the DamerauLevenshteinDistance instance with the left and right similarity inputs
        Integer left_to_right_distance = damerau_levenshtein_instance.apply(left_similarity_input, right_similarity_input);

        // Step 5: Invoke the apply method on the DamerauLevenshteinDistance instance with the right and left similarity inputs (reversed)
        Integer right_to_left_distance = damerau_levenshtein_instance.apply(right_similarity_input, left_similarity_input);

        // Step 6: Assert that the left-to-right distance matches the expected distance value
        Assertions.assertEquals(expected_distance, left_to_right_distance);

        // Step 7: Assert that the right-to-left distance matches the expected distance value
        Assertions.assertEquals(expected_distance, right_to_left_distance);
    }

    private static SimilarityInput createSimilarityInput(String content) {
        // CharSequenceSimilarityInput is part of Apache Commons Text and is required here.
        return new CharSequenceSimilarityInput(content);
    }

    private static Stream<Arguments> damerauLevenshteinDistanceTestCases() {
        return Stream.of(
                // Test cases with realistic thresholds
                // Note: DamerauLevenshteinDistance returns the threshold if the actual distance exceeds it.
                Arguments.of("kitten", "sitting", 2, 2), // Actual distance 3, threshold 2 -> returns 2
                Arguments.of("saturday", "sunday", 3, 3), // Actual distance 3, threshold 3 -> returns 3
                Arguments.of("apple", "aple", 1, 1), // Actual distance 1, threshold 1 -> returns 1
                Arguments.of("apple", "apply", 1, 1), // Actual distance 1, threshold 1 -> returns 1
                Arguments.of("apple", "banana", 5, 5), // Actual distance 6, threshold 5 -> returns 5
                Arguments.of("test", "test", 0, 0), // Identical strings, distance 0
                Arguments.of("test", "toast", 1, 1), // Actual distance 2, threshold 1 -> returns 1
                Arguments.of("hello", "world", 5, 5) // Actual distance 5, threshold 5 -> returns 5
        );
    }
