import org.junit.jupiter.params.ParameterizedTest;
import org.junit.jupiter.params.provider.CsvSource;
import static org.junit.jupiter.api.Assertions.assertEquals;
import static org.junit.jupiter.api.Assertions.assertTrue;
import org.apache.commons.text.similarity.LevenshteinDistance;

public class LevenshteinDistanceParameterizedTest {

    @ParameterizedTest
    @CsvSource({
        "kitten, sitting, 2, -1",
        "apple, aple, 1, 1",
        "apple, apple, 0, 0"
    })
    void testLevenshteinDistanceSymmetryAndThreshold(
            String sequence_1,
            String sequence_2,
            Integer max_distance_threshold,
            Integer expected_distance) {

        // Step 0: Configure the text similarity service with a maximum distance threshold
        LevenshteinDistance configured_service = new LevenshteinDistance(max_distance_threshold);

        // Step 1, 2, 3 are handled by @CsvSource and method parameters
        CharSequence text_input_A = sequence_1;
        CharSequence text_input_B = sequence_2;

        // Step 4: Calculate similarity distance comparing text input A to text input B
        Integer distance_A_to_B = configured_service.apply(text_input_A, text_input_B);

        // Step 5: Calculate similarity distance comparing text input B to text input A
        Integer distance_B_to_A = configured_service.apply(text_input_B, text_input_A);

        // Step 6: Verify distance from A to B matches the expected distance
        assertEquals(expected_distance, distance_A_to_B, "Distance A to B should match expected distance");

        // Step 7: Verify distance from B to A matches the expected distance
        assertEquals(expected_distance, distance_B_to_A, "Distance B to A should match expected distance");

        // Step 8: Confirm distance from A to B is identical to distance from B to A
        assertEquals(distance_A_to_B, distance_B_to_A, "Distance A to B should be identical to distance B to A");

        // Step 9: Assert that the calculated distances respect the maximum distance threshold
        // If expected_distance is -1, it means the distance exceeded the threshold.
        // In this case, the assertion should check that both distances are -1.
        if (expected_distance == -1) {
            assertTrue(distance_A_to_B == -1 && distance_B_to_A == -1, "Distances should be -1 when exceeding threshold");
        } else {
            assertTrue(distance_A_to_B <= max_distance_threshold && distance_B_to_A <= max_distance_threshold, "Distances should not exceed max_distance_threshold");
        }
    }
}

