package com.example.text.similarity;

import org.apache.commons.text.similarity.DamerauLevenshteinDistance;
import org.junit.jupiter.api.BeforeAll;
import org.junit.jupiter.api.Assertions;
import org.junit.jupiter.params.ParameterizedTest;
import org.junit.jupiter.params.provider.MethodSource;
import org.junit.jupiter.params.provider.Arguments;

import java.lang.reflect.InvocationTargetException;
import java.util.stream.Stream;

public class DamerauLevenshteinDistanceSymmetryTest {

    private static DamerauLevenshteinDistance distanceCalculator;

    @BeforeAll
    static void setup() {
        distanceCalculator = new DamerauLevenshteinDistance();
    }

    @ParameterizedTest
    @MethodSource("provideStringsForSymmetryTest")
    void testSymmetry(String stringInput1, String stringInput2, Integer expectedDistance, Class<? extends CharSequence> similarityInputClass, Class<? extends Throwable> expectedException) throws NoSuchMethodException, InvocationTargetException, InstantiationException, IllegalAccessException {
        if (expectedException != null) {
            Assertions.assertThrows(expectedException, () -> {
                CharSequence similarityInput1 = createSimilarityInput(stringInput1, similarityInputClass);
                CharSequence similarityInput2 = createSimilarityInput(stringInput2, similarityInputClass);
                distanceCalculator.apply(similarityInput1, similarityInput2);
            });
            Assertions.assertThrows(expectedException, () -> {
                CharSequence similarityInput1 = createSimilarityInput(stringInput1, similarityInputClass);
                CharSequence similarityInput2 = createSimilarityInput(stringInput2, similarityInputClass);
                distanceCalculator.apply(similarityInput2, similarityInput1);
            });
        } else {
            CharSequence similarityInput1 = createSimilarityInput(stringInput1, similarityInputClass);
            CharSequence similarityInput2 = createSimilarityInput(stringInput2, similarityInputClass);

            Integer forwardDistance = distanceCalculator.apply(similarityInput1, similarityInput2);
            Integer backwardDistance = distanceCalculator.apply(similarityInput2, similarityInput1);

            Assertions.assertEquals(expectedDistance, forwardDistance, "Forward distance should match expected distance");
            Assertions.assertEquals(expectedDistance, backwardDistance, "Backward distance should match expected distance");
        }
    }

    private static CharSequence createSimilarityInput(String value, Class<? extends CharSequence> type) throws NoSuchMethodException, InvocationTargetException, InstantiationException, IllegalAccessException {
        if (value == null) {
            return null;
        }
        if (type.equals(String.class)) {
            return value;
        }
        return type.getDeclaredConstructor(String.class).newInstance(value);
    }

    private static Stream<Arguments> provideStringsForSymmetryTest() {
        return Stream.of(
                Arguments.of("apple", "aple", 1, String.class, null),
                Arguments.of("kitten", "sitting", 3, String.class, null),
                Arguments.of("flaw", "lawn", 2, String.class, null),
                Arguments.of("", "", 0, String.class, null),
                Arguments.of("a", "", 1, String.class, null),
                Arguments.of("", "b", 1, String.class, null),
                Arguments.of(null, null, null, String.class, IllegalArgumentException.class),
                Arguments.of("test", null, null, String.class, IllegalArgumentException.class),
                Arguments.of(null, "test", null, String.class, IllegalArgumentException.class),
                Arguments.of("abc", "abc", 0, String.class, null)
        );
    }
}

