import org.apache.commons.text.translate.OctalUnescaper;
import org.apache.commons.text.translate.CharSequenceTranslator;

public class OctalUnescaperTest {

    @Test
    void testInvalidOctalSequencePreservation() {
        // Step 0: Configure octal unescaping capability within the text processing system
        CharSequenceTranslator text_processing_system = new OctalUnescaper();

        // Step 1: Provide an input sequence that starts with an escape marker followed by a digit and a letter (e.g., '\1a')
        String invalid_octal_input_sequence = "\\1a";

        // Step 2: Define the expected partially-processed form (e.g., '\u0001a')
        String expected_partially_processed_form = "\u0001a";

        // Step 3: Direct the text processing system to process the input sequence through the unescaping transformation
        String processed_output = text_processing_system.translate(invalid_octal_input_sequence);

        // Step 4 & 5 are narrative and covered by the assertion in Step 6.

        // Step 6: Confirm the processed output matches the expected partially-processed form
        assertEquals(expected_partially_processed_form, processed_output);
    }
}

package org.apache.commons.text.translate;

import org.junit.jupiter.api.Test;
import static org.junit.jupiter.api.Assertions.assertEquals;

public class OctalUnescaperTest1 {

    @Test
    public void testOctalUnescaperTranslation() {
        // Step 0: Instantiate a new OctalUnescaper object
        OctalUnescaper oue = new OctalUnescaper();

        // Step 1: Declare an input string with the literal value "\4a"
        String input = "\\4a";

        // Step 2: Invoke the translate method on the OctalUnescaper with the input string
        String result = oue.translate(input);

        // Step 3: Assert that the translated result equals the expected unescaped string "\4a"
        assertEquals("\u0004a", result, "Failed to unescape octal characters via the between method");
    }
}

