import org.junit.jupiter.api.Test;
import static org.junit.jupiter.api.Assertions.assertThrows;
import org.apache.commons.text.translate.UnicodeUnescaper;

public class UnicodeUnescaperTest {

    @Test
    void testMalformedUnicodeEscapeSequenceThrowsIllegalArgumentException() {
        // Step 0: Instantiate a new Unicode Unescaper component
        UnicodeUnescaper unicodeUnescaper = new UnicodeUnescaper();

        // Step 1: Prepare a string containing an incomplete Unicode escape sequence
        String malformedUnicodeString = "\\" + "u"; // Corrected: Constructing the string to avoid compile-time unicode escape interpretation

        // Step 2 & 3: Invoke the translate method and verify that an IllegalArgumentException is thrown
        assertThrows(IllegalArgumentException.class, () -> {
            unicodeUnescaper.translate(malformedUnicodeString);
        });
    }
}

